INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("2025/01/31 12:00:00", -285.0, 133701, 10201, 101, "ラビリスタ", -6.0, "2030/01/01 14:59:59", 61, 7, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 3, 1020101, 5.18);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("2025/01/31 12:00:00", -285.0, 133901, 10201, 201, "クリスティーナ", -2.0, "2030/01/01 14:59:59", 61, 2, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 1, 1020102, 8.77);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("2025/01/31 12:00:00", -285.0, 133801, 10201, 301, "ネネカ", 0.0, "2030/01/01 14:59:59", 61, 1, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 6, 1020103, 15.5);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("2025/02/28 12:00:00", -285.0, 134301, 10202, 101, "ランファ", 0.0, "2030/01/01 14:59:59", 61, 5, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 2, 1020201, 9.061);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("2025/02/28 12:00:00", -285.0, 134401, 10202, 201, "チカ", 0.0, "2030/01/01 14:59:59", 61, 2, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 1, 1020202, 7.699);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("2025/03/31 12:00:00", -285.0, 134601, 10203, 101, "アオイ", 0.0, "2030/01/01 14:59:59", 61, 2, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 1, 1020301, 8.595);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("2025/03/31 12:00:00", -285.0, 134501, 10203, 201, "クローチェ", 0.0, "2030/01/01 14:59:59", 61, 2, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 1, 1020302, 7.758);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("2025/04/30 12:00:00", -285.0, 132302, 10204, 101, "ルイズマリー", 0.0, "2030/01/01 14:59:59", 61, 6, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 2, 1020401, 7.0);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("2025/04/30 12:00:00", -285.0, 132402, 10204, 201, "イロハ", 0.0, "2030/01/01 14:59:59", 61, 2, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 1, 1020402, 7.904);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("2025/04/30 12:00:00", -285.0, 132502, 10204, 301, "ソノ", 0.0, "2030/01/01 14:59:59", 61, 2, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 4, 1020403, 8.487);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("2025/05/31 12:00:00", -285.0, 134901, 10205, 101, "カノン", 0.0, "2030/01/01 14:59:59", 61, 2, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 1, 1020502, 8.763);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES ("2025/05/31 12:00:00", -285.0, 134801, 10205, 201, "ツムギ", 0.0, "2030/01/01 14:59:59", 61, 3, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 1, 1020503, 6.417);
